import React from 'react';
import { Link } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <div className="nav_bar">
      <Link to='/login'>
        <li>Login</li>
      </Link>
      <Link to='/signup'>
        <li>Signup</li>
      </Link>
    </div>
  );
}

export default App;
